import * as React from "react";
import { Container, Row, Col } from "bootstrap";

export default function BasicGrid() {
  return (
    <Container>
      <Row>
        <Col>what</Col>
        <Col>2 of 2</Col>
      </Row>
      <Row>
        <Col>1 of 3</Col>
        <Col>2 of 3</Col>
        <Col>3 of 3</Col>
      </Row>
    </Container>
  );
}
